import React, { useState } from "react";
import styled from "styled-components";
import earthimg from "../photo/earth1.png";
const WholeBack = styled.div`
  background-color: #abc5d8;
  width: 100%;
  height: 100vh;
  padding-top: 10rem;
  position: relative; /* 자식 엘리먼트의 위치를 상대적으로 설정하기 위해 필요합니다. */
`;
const EarthImg = styled.div`
  position: absolute;
  bottom: 0rem;
  img {
    width: 20rem;
  }
`;
function Earth() {
  return (
    <WholeBack>
      <EarthImg>
        <img src={earthimg} alt="earth" />
      </EarthImg>
    </WholeBack>
  );
}

export default Earth;
